import React from "react";
import "./Adminorderlist.css";
import {AiOutlineArrowRight} from "react-icons/ai";

export default function Adminorderlist() {
    return (
      <>
        <div className="adminorderlist">
          <div className="adminorderlist_middle">
            <Singleadminorderlist
              id={"o1001"}
              price={"$1200"}
              cost={"$234"}
              product={"Apple iPad"}
              cname={"Sylvia Sullivan"}
              sdate={"15 Jan 2026"}
              edate={"15 Jan 2019"}
              dstatus={"Expectation"}
            />
          </div>
          <div className="adminorderlist_end">
            <button>Load More Products</button>
          </div>
        </div>
      </>
    );
  }
  
  function Singleadminorderlist({ id,price,cost,product,cname,sdate,edate,dstatus }) {
    return (
      <>
        <div className="singleadminorderlist">
          <div className="singleadminorderlist_row">
            <div className="singleadminorderlist_row_button">
              <input type="radio"></input>
            </div>
            <label className="singleadminorderlist_row_producer">{id}</label>
            <label className="singleadminorderlist_row_product">{price}</label>
            <label className="singleadminorderlist_row_id">{cost}</label>
            <label className="singleadminorderlist_row_cat">{product}</label>
            <label className="singleadminorderlist_row_link">{cname}</label>
            <span className="singleadminorderlist_row_cost">{sdate}</span>
            <span className="singleadminorderlist_row_extra">{edate}</span>
            <div className="singleadminorderlist_row_input">
                <input/>
            <span className="singleadminorderlist_row_input_status">{cstatus}</span>
            </div>
            <AiOutlineArrowRight className="singleadminorderlist_row_arrow" style={{color:'#D2D7E3'}}/>
          </div>
        </div>
      </>
    );
  }
